import logo from './logo.svg';
import './App.css';
import NavBar from './NavBar.js'
import Carousel from './carousel.js'
import Card from './Card'
import SignUp from '/Signuo.js'

var obj={
  image:"flag.png",
  name:"America"
}

function App() {
  return (
    <div className="App">
      <SignUp></SignUp>
     <NavBar/>
     <Carousel></Carousel>

     <Card countrydata={obj}></Card>


    </div>
  );
}

export default App;
